import React from 'react';
import ButtonGroup from 'react-bootstrap/ButtonGroup'
import Button from 'react-bootstrap/Button'
import {BrowserRouter, Route, Switch, Link}  from 'react-router-dom'; //npm i react-router-dom --save


const HistoryTab = () => {
  return(
    <div name="Events History Table" width="70%" Style="text-align:left;">
      <div name="History Tab" width="70%">
      {/* <h3>Select Log History: </h3> */}
      <ButtonGroup size="lg" className="mb-2">
          <Button disabled>Event History</Button>
          <Button>Download History</Button>
          <Link to="/downloads">Download History </Link>
        </ButtonGroup>

        <Switch>
          <Route path="/" component={LoginForm} exact/>
          <Route path="/downloads" component={DownloadsTable} />
          <Route path="/events" component={EventsTable} />
          <Route component={Error} />
        </Switch>
      </div>
      <br/>
    </div>
  );
}

export default HistoryTab;
